import React from "react";
import './index.css';
import {
    Link,
    NavLink,
    BrowserRouter as Router
} from "react-router-dom";

import Signup from "./Signup.js";

function HPNavBar(){
    return(
        
        <div className="navBar" id="homePageNB">
            <ul id="hpURLList">
                <li>Virtual Version</li>
                <li className="nvUpperRightOptions"><NavLink to="/login"><button>Log in</button></NavLink></li>
                <li className="nvUpperRightOptions"><NavLink to="/signup"><button>Sign up</button></NavLink></li>
            </ul>
        </div>
    );
}

export default HPNavBar;
